import React, { Component } from 'react'

class Search extends Component {


  handleSearch = event => {

    const user_id = ''

    setTimeout(() => {
      fetch(`https://api.spreaker.com/v2/me?oauth2_access_token=20e75b947a1909b99b242724438ed46dad9576b1`)
        .then(response => response.json())
        .then(data => {
          console.log(data);
          this.setState({
            user_id: data.user_id
          },
          console.log(user_id))
        })
    }, 200)
  }

  render() {


    return (
      <div>

        <button onClick={this.handleSearch} >Search</button>

      </div>
    )
  }
}

export default Search
